import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Signup.css';
import due from "./image/due.jpg";
import cutm from "./image/cutm.png";

const SignupII = () => {
  const navigate = useNavigate(); // Changed variable name from 'history' to 'navigate'

  const [username, setUsername] = useState(''); // Added state for username
  const [password, setPassword] = useState(''); // Added state for password

  const handleUsernameChange = (event) => {
    setUsername(event.target.value);
  };

  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  };

  const handleLogin = () => {
    // Add your login logic here
    // For example, navigate('/dashboard') to redirect after successful login
  };

  return (
    <div className='body'>
      <div className='main'>
        <div className='tittle'>
          <img src={cutm} alt="cutm" className='cutm'/>
          <h1><i><u>Online</u></i></h1>
          <h2><i><u>No Due</u></i></h2>
        </div>
        <div className='sub'>
          <div className='due_b'>
            <img src={due} alt="due" className='due'/>
          </div>
          <div className='info'>
            <input type="text" placeholder="First Name" className="name" value={username} onChange={handleUsernameChange} />
            <br />
            <input type="text" placeholder="Last Name" className="name" />
            <br />
            <input type="text" placeholder="Email" className="name" />
            <br />
            <input type="password" placeholder="Password" className="pass" value={password} onChange={handlePasswordChange} />
            <div className='login_button'>
              <button onClick={handleLogin}>Login</button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SignupII;
